import React from "react";
import {
  Badge,
  Button,
  Card,
  Navbar,
  Nav,
  Table,
  Container,
  Row,
  Col,
} from "react-bootstrap";

const TableChofere = () => {
  return (
    <>
      <Container>
        <Row>
          <Col md="12">
            <Card className="strpied-tabled-with-hover">
              <Card.Header>
                <Card.Title as="h4">Aqui av el titulo de la tabla</Card.Title>
                <p className="card-category">Este es el subititulo</p>
              </Card.Header>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default TableChofere;
